$(function(){$(".tree .toggle").live("click",function(t){t.preventDefault();var e=$(this).parents("li:first"),i=e.find(".icon.toggle"),n=e.find(".nested");if(i.hasClass("expanded"))i.removeClass("expanded"),n.slideUp();else{var s=n.attr("data-ajax-content");e.addClass("loading"),n.load(s,function(){n.find("li:last").addClass("branch_end"),i.addClass("expanded"),init_tooltips(),n.slideDown(),e.removeClass("loading")})}})});